description:
Couldn't find any more infos about it, except that it's in a limited
edition from 1989. Which is why I guess it might be ok for them that I'm
sharing it.

Atonal, electronic, and dark ambient music. I'd say somewhere between
Lull and Asmus Tietchens. Hardly suitable for a birthday party.

